import  React from 'react'
import {
    Link,
    useRouteMatch
  } from "react-router-dom";
  import './styleNav.css';

function Nav(){
    let { url } = useRouteMatch();
    return(
        <nav className='navbar'>
        <Link to={`${url}application/info`} className='links'>Info</Link>
        <Link to={`${url}application/toodos`} className='links'>Toodos</Link>
        <Link to={`${url}application/posts`} className='links'>Posts</Link>
        <Link to={`${url}application/albums`} className='links'>Albums</Link>
        </nav>
    )
}
export default Nav;
